import Button from './Button';
import './display.css'

const button = <Button text="Reserve"/>

function BoxDisplay({imgLink, title="Title", cost="$1", button}) {
    return ( 
    <div className="box-display">
        <img src={imgLink} />
        <h3>{title}</h3>
        <p>{cost}</p>
        {button}
    </div>
    )
}

export default BoxDisplay;
